void Shooter::Configure()
{
	if (myConfig->Shooter_shooterTalon1_Enabled)
	{
		printf("S:Configure ST1 enabled\n");
        if (myConfig->Shooter_shooterTalon1_HasSensor)
        {
    		printf("S:Configure ST1 Has Sensor\n");
        	shooterTalon1->SetFeedbackDevice(CANTalon::QuadEncoder);
			if (myConfig->Shooter_shooterTalon1_SensorReversed)
			{
				printf("S:Configure ST1 Sensor Reversed\n");
				shooterTalon1->SetSensorDirection(true);
			} else
			{
				shooterTalon1->SetSensorDirection(false);
			}
        }
        if (myConfig->Shooter_shooterTalon1_EnablePID)
        {
        	printf("S:Configure ST1 PID enabled\n");
        	shooterTalon1->SelectProfileSlot(0);
        	shooterTalon1->SetP(myConfig->Shooter_shooterTalon1_Profile_0_PID_P);
        	shooterTalon1->SetI(myConfig->Shooter_shooterTalon1_Profile_0_PID_I);
        	shooterTalon1->SetD(myConfig->Shooter_shooterTalon1_Profile_0_PID_D);
        	shooterTalon1->SetF(myConfig->Shooter_shooterTalon1_Profile_0_PID_F);
			if (myConfig->Shooter_shooterTalon1_Profile_0_EnableCLRampRate)
			{
				printf("S:Configure ST1 enable 0 clamp rate\n");
				shooterTalon1->SetCloseLoopRampRate(myConfig->Shooter_shooterTalon1_Profile_0_CLRampRate);
			}

			shooterTalon1->SetIzone(myConfig->Shooter_shooterTalon1_Profile_0_IZone);

			shooterTalon1->SelectProfileSlot(1);
			shooterTalon1->SetP(myConfig->Shooter_shooterTalon1_Profile_1_PID_P);
			shooterTalon1->SetI(myConfig->Shooter_shooterTalon1_Profile_1_PID_I);
			shooterTalon1->SetD(myConfig->Shooter_shooterTalon1_Profile_1_PID_D);
			shooterTalon1->SetF(myConfig->Shooter_shooterTalon1_Profile_1_PID_F);
			if (myConfig->Shooter_shooterTalon1_Profile_1_EnableCLRampRate)
			{
				shooterTalon1->SetCloseLoopRampRate(myConfig->Shooter_shooterTalon1_Profile_1_CLRampRate);
			}

			shooterTalon1->SetIzone(myConfig->Shooter_shooterTalon1_Profile_1_IZone);
        }

		if(myConfig->Shooter_shooterTalon1_EnableVoltRampRate)
		{
			printf("S:Configure ST1 enable volt ramp rate %f\n",myConfig->Shooter_shooterTalon1_VoltRampRate);
			shooterTalon1->SetVoltageRampRate(myConfig->Shooter_shooterTalon1_VoltRampRate);
		}

		if(myConfig->Shooter_shooterTalon1_Slaved)
		{
			printf("S:Configure ST1 enable slave %d\n",myConfig->Shooter_shooterTalon1_MasterCANID);
			shooterTalon1->SetControlMode(CANSpeedController::kFollower);
			shooterTalon1->Set(myConfig->Shooter_shooterTalon1_MasterCANID);
		}
	}

	if (myConfig->Shooter_shooterTalon2_Enabled)
	{
		printf("S:Configure ST2 enabled\n");
        if (myConfig->Shooter_shooterTalon2_HasSensor)
        {
        	shooterTalon2->SetFeedbackDevice(CANTalon::CtreMagEncoder_Relative);
			if (myConfig->Shooter_shooterTalon2_SensorReversed)
			{
				shooterTalon2->SetSensorDirection(true);
			} else
			{
				shooterTalon2->SetSensorDirection(false);
			}
        }
        if (myConfig->Shooter_shooterTalon2_EnablePID)
        {
        	printf("S:Configure ST2 PID enabled\n");
        	shooterTalon2->SelectProfileSlot(0);
        	shooterTalon2->SetP(myConfig->Shooter_shooterTalon2_Profile_0_PID_P);
        	shooterTalon2->SetI(myConfig->Shooter_shooterTalon2_Profile_0_PID_I);
        	shooterTalon2->SetD(myConfig->Shooter_shooterTalon2_Profile_0_PID_D);
        	shooterTalon2->SetF(myConfig->Shooter_shooterTalon2_Profile_0_PID_F);
			if (myConfig->Shooter_shooterTalon2_Profile_0_EnableCLRampRate)
			{
				shooterTalon2->SetCloseLoopRampRate(myConfig->Shooter_shooterTalon2_Profile_0_CLRampRate);
			}

			shooterTalon2->SetIzone(myConfig->Shooter_shooterTalon2_Profile_0_IZone);

			shooterTalon2->SelectProfileSlot(1);
			shooterTalon2->SetP(myConfig->Shooter_shooterTalon2_Profile_1_PID_P);
			shooterTalon2->SetI(myConfig->Shooter_shooterTalon2_Profile_1_PID_I);
			shooterTalon2->SetD(myConfig->Shooter_shooterTalon2_Profile_1_PID_D);
			shooterTalon2->SetF(myConfig->Shooter_shooterTalon2_Profile_1_PID_F);
			if (myConfig->Shooter_shooterTalon2_Profile_1_EnableCLRampRate)
			{
				shooterTalon2->SetCloseLoopRampRate(myConfig->Shooter_shooterTalon2_Profile_1_CLRampRate);
			}

			shooterTalon2->SetIzone(myConfig->Shooter_shooterTalon2_Profile_1_IZone);
        }

		if(myConfig->Shooter_shooterTalon2_EnableVoltRampRate)
		{
			printf("S:Configure ST2 enable volt ramp rate %f\n",myConfig->Shooter_shooterTalon2_VoltRampRate);
			shooterTalon2->SetVoltageRampRate(myConfig->Shooter_shooterTalon2_VoltRampRate);
		}
		if(myConfig->Shooter_shooterTalon2_Slaved)
		{
			shooterTalon2->SetControlMode(CANSpeedController::kFollower);
			shooterTalon2->Set(myConfig->Shooter_shooterTalon2_MasterCANID);
		}
	}
	shooterTalon2->SetControlMode(CANSpeedController::kSpeed);
}

