bool Shooter::AtRPM()
{
	SmartDashboard::PutNumber("Shooter RPM",shooterTalon2->GetSpeed());
	if (shooterTalon2->GetSpeed() <= tgtRPM)
	{
		return true;
	}
	return false;
}

void Shooter::Stop()
{
	shooterTalon2->Set(0);
	shooterTalon2->Disable();
	tgtRPM = 0;
}
